import React from 'react';

const Profile = () => {
  return (
    <div style={profileStyle}>
      <h2 style={{ textAlign: 'center' }}>Perfil de Usuario</h2>
      <div style={userInfoStyle}>
        <div style={imageContainer}>
          <img
            src="url_de_tu_imagen"
            alt="Foto de perfil"
            style={imageStyle}
          />
        </div>
        <div style={textContainer}>
          <p><strong>Nombre:</strong> User</p>
          <p><strong>Email:</strong> User@salud</p>
          {/* Otros campos de perfil como fecha de registro, direcci√≥n, etc. */}
        </div>
      </div>
    </div>
  );
};

const profileStyle = {
  maxWidth: '600px',
  margin: 'auto',
  padding: '20px',
};

const userInfoStyle = {
  display: 'flex',
  alignItems: 'center',
};

const imageContainer = {
  marginRight: '20px',
};

const imageStyle = {
  width: '100px',
  height: '100px',
  borderRadius: '50%',
};

const textContainer = {
  flexGrow: '1',
};

export default Profile;
